            setLatitude(eras[6].centerCoords[0])
            setLongitude(eras[6].centerCoords[1])
            setZoom(eras[6].zoom)
        }
        if(eras[6].complete && !eras[7].complete) {
            setLatitude(eras[7].centerCoords[0])
            setLongitude(eras[7].centerCoords[1])
            setZoom(eras[7].zoom)
        }
